import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({

    background: {

        width : '100%',
        height : '100%',
        backgroundColor: '#000',
        justifyContent: 'space-evenly',
        alignItems: 'center',
    },

    container: {

        width: '100%',
        height: '100%',
        backgroundColor: '#000',
        margin: 40,
        alignItems: 'center',
    },

    title: {

        flex : .2,
        color: '#fff',
        fontSize: 28,
        paddingTop : 60,
        paddingBottom : 10,
    },

});
